DROP TABLE IF EXISTS `sdk_user`;
CREATE TABLE `sdk_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `username` varchar(255) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '密码',
  `mobile` varchar(11) NOT NULL DEFAULT '' COMMENT '手机号',
  `uuid` varchar(60) NOT NULL DEFAULT '' COMMENT '设备号',
  `mac` varchar(255) NOT NULL DEFAULT '' COMMENT '设备id',
  `android_id` varchar(255) NOT NULL DEFAULT '' COMMENT '安卓id',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态0正常 -1锁定',
  `register_ip` bigint(10) unsigned NOT NULL DEFAULT '0' COMMENT '注册ip 转成int',
  `register_platform` tinyint(4) NOT NULL DEFAULT '0' COMMENT '注册来源0 安卓 1 IOS',
  `last_login_time` int(10) unsigned NOT NULL COMMENT '最后登录时间',
  `register_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `last_login_ip` bigint(10) NOT NULL DEFAULT '0' COMMENT '最后一次登录ip 转成int',
  `promopage_plan_id` int(10) NOT NULL DEFAULT '0' COMMENT '计划id',
  `gateway_id` int(10) NOT NULL DEFAULT '0' COMMENT '渠道id',
  `game_server_id` int(10) NOT NULL DEFAULT '0' COMMENT '区服id',
  `game_id` int(10) NOT NULL DEFAULT '0' COMMENT '游戏id',
  `promopage_id` int(10) NOT NULL COMMENT '母落地页id',
  `promopage_sub_id` int(10) NOT NULL COMMENT '子落地页id',
  `coin` int(10) NOT NULL DEFAULT '0' COMMENT '平台币',
  `gift_coin` int(10) NOT NULL DEFAULT '0' COMMENT '赠送的平台币',
  `openid` varchar(128) NOT NULL DEFAULT '' COMMENT '微信openid',
  PRIMARY KEY (`id`),
  KEY `id` (`id`,`status`),
  KEY `ip` (`register_ip`),
  KEY `mobile` (`mobile`),
  KEY `reg_time` (`register_time`),
  KEY `openid` (`openid`)
) ENGINE=InnoDB AUTO_INCREMENT=1234684 DEFAULT CHARSET=utf8 COMMENT='sdk用户表';

